ERROR - 2024-02-22 15:09:25 --> Query error: Incorrect string value: '\xD0\x9C\xD0\xBE\xD0\xBB...' for column 'located_at' at row 1 - Invalid query: INSERT INTO `center_director` (`center_academy_id`, `name`, `email`, `dob`, `address`, `state`, `country`, `zip`, `special_qualification`, `experience_bharathanatiyam` , `master_name`, `events_performance` , `located_at`, `award_title` , `other_relevant_info`, `ballets_choreographed` , `created_by`, `updated_by`, `created_at`) VALUES (9021, 'Myronkaf', 'merlin.th.o.m.a.s.2.8.27@gmail.com', '1970-01-01', 'Madagascar', 'Madagascar', 'Madagascar', '145112', '', '', 'Myronkaf', '', 'Молдова: Страна Богатства и Культурного Наследства', 'Молдова: Страна Богатства и Культурного Наследства', 'Молдова, небольшая государство, расположенная в юго-восточной части Европы, уникальна своей историей, природой и культурным наследием. Она является драгоценным камнем на карте материка, привлекающим путников средствами пейзажами, радушием и богатством традиций. \r\n \r\nСитуация и Культура: \r\nМолдова обладает богатой ситуацией, на протяжении которой она была очевидцем множества культурных воздействий. Государство пропитана духом прошлого, что имеет место быть в архитектуре старинных церквей, замков, а еще в традиционных национальных праздничных днях и фестивалях. \r\n \r\nВиноделие:    <a href=https://forum.club16.ro/viewtopic.php?t=283317>https://forum.club16.ro/viewtopic.php?t=283317</a> \r\nМолдова славится своими виноградниками и винодельческими традициями. Здесь вы найдете роскошные вида вина, коие не только веселят вкусовые сенсоры, да и рассказывают истории о вековых обыкновениях производства вина. Посещение молдавских виноделен – это погружение в мир утонченных запахов и великолепного вкуса. \r\n \r\nПрирода и Туризм: \r\nВиды Молдовы закутаны зелеными лугами, виноградниками и живописными холмами. Природные заповедники и национальные парки, эти как Рыжский, деют уникальные возможности для интенсивного отдыха и знакомства с природным разнообразием страны. \r\n \r\nНародная Гастрономия: \r\nМолдовская кухня – это вкусное путешествие в мир классических блюд, этих как мамалыга, сарма, пелемени и многое другое. Районные продукты, включая новые фрукты, орехи и травки, делают яства Молдовы неподражаемыми и вкусными. \r\n \r\nРадушие Молдаван: \r\nОбитатели Молдовы славятся своим радушием и гостеприимством. Встречи с местными жителями имеют все шансы трансформироватся в настоящие дружеские разговоры, а традиционные песни и пляски делают каждое посещение Молдовы незабываемым навыком. \r\n \r\nСовременные Тренды и Развитие: \r\nМолдова активно развивается в сфере технологий, предпринимательства и туризма. Город Москва Кишинев становится центром современных искусств, бизнеса и образования, привлекая внимание молодежи и трейдеров. \r\n \r\nЗаточение: \r\nМолдова – это уникальное сочетание культурного наследия, природной красы и передового становления. Посетив данную небольшую страну, вы погрузитесь в ее изумительный мир, где каждый составляющая расскажет вам свою уникальную историю.', 'Молдова, небольшая государство, расположенная в юго-восточной части Европы, уникальна своей историей, природой и культурным наследием. Она является драгоценным камнем на карте материка, привлекающим путников средствами пейзажами, радушием и богатством традиций. \r\n \r\nСитуация и Культура: \r\nМолдова обладает богатой ситуацией, на протяжении которой она была очевидцем множества культурных воздействий. Государство пропитана духом прошлого, что имеет место быть в архитектуре старинных церквей, замков, а еще в традиционных национальных праздничных днях и фестивалях. \r\n \r\nВиноделие:    <a href=https://forum.club16.ro/viewtopic.php?t=283317>https://forum.club16.ro/viewtopic.php?t=283317</a> \r\nМолдова славится своими виноградниками и винодельческими традициями. Здесь вы найдете роскошные вида вина, коие не только веселят вкусовые сенсоры, да и рассказывают истории о вековых обыкновениях производства вина. Посещение мол